import React from 'react';

export default function Monthlyaddons(props) {
  const { name, cost, text } = props;
  console.log(name);
  const planPrice = useSelector((state) => state.counter.value);
  console.log(planPrice);
  return (
    <>
      <form>
        <div className="options">
          <div className="option">
            <label for="arcade1">
              <input type="checkbox" name={name} value={cost} id={text}></input>
              <h2>{name}</h2>
              <p>{text}</p>
              <span>{cost}</span>
            </label>
          </div>
        </div>
      </form>
    </>
  );
}
